import React, { useState, Componrnt} from 'react';
import {  Routes, Route } from "react-router-dom";
import classes from './Dropdown.module.css'
import Offers from '../Offers/Offers';

 

 const Dropdown = () => {


	const brands = [

		{ 
 
			id : 'binomo',
			label : 'Binomo',
			book : '',
			creatives : '',
			googleplay : '',
			appstor : '',
			site : '',
			figma : '',
			recommend : ''
 
			} ,
			
			{
				
				id : 'octafx',
				label : 'OctaFx',
				book : '',
				creatives : '',
				googleplay : '',
				appstor : '',
				site : '',
				figma : '',
				recommend : ''
			
			}
		
	]

  const BrandsNav = brands.map((item) =>{
		return (
     <div  className={classes.dropdown_item}>
			<div>{item.label}
      <Routes>
			<Route path="/offers/id*" element={<Offers/>}/>
			</Routes>
			</div>
	   </div>

		)


	})

	return (
		<div>

    <button className={classes.dropdown_btn} onClick={BrandsNav()}>Brandbooks</button>


	

		</div>

 	)

}



export default Dropdown;
